  const echarts = require('echarts/dist/echarts');
  import map from '../../js/map'
  export default {
    components: {},
    name: "building-navigation",
    data(){
      const getDT =_=>{
        /*var url = require('../../assets/logo.png');*/
        var dt1 = [];
        var dt2 =[]
        let params = {
          dt1:dt1,
          dt2:dt2
        }
        return params ;
      }
      return {
        radio: '70',
        radioUrl: '1',
        dt1:getDT().dt1,
        dt2:getDT().dt2,
        current: [],  //当日水量
        weekIncrement: [],  //周同比增减量
        weekRatio: [], //周同比增减率
        minimumIncrement: [], //最小流量周同比增减量
        minimumRatio: [], //最小流量周同比增减率
        compositeIndex: [], //综合漏损指数
        max: 1000,  //热力图最大值
        min: 0, //热力图最小值
        url: 'BuildingWaterUseOverview', //跳转路径
        show: false,
        legend: [],
      }
    },
    created() {
      this.getInf();
    },
    methods: {
      /*给图例赋值*/
      getLegendData(options) {
        let legend = this.legend;
        let category = this.radio;
        let pieces = [],obj;
        let color = ["#159c14","#51b447","#53c257","#d5ffc7","#f4ffee","#FFFFFF","#ffe1c5","#ffc7b5","#ff8e7a","#ff6f64","#ff4036","#c13330","#b43330","#762421","#000000"]
        let arr = legend.filter(item => item.category == category);
        if(arr.length > 0) {
          obj = arr[0];
          pieces.push({max: obj['range1'],label: '<' + obj['range1'],color: color[0]})
          for(var i = 1; i < 14 ; i ++) {
            let min = 'range' + i;
            let max = 'range' + (i + 1);
            min = obj[min];
            max = obj[max];
            if(i < 13) {
              pieces.push({min: min,max: max - 1,label: min + '~' + (max - 1),color: color[i]});
            }else {
              pieces.push({min: min,max: max - 1,label: min + '~' + max,color: color[i]});
            }
          }
          pieces.push({min: obj['range14'],label: '>' + obj['range14'],color: color[14]});
        }else {
          pieces.push ({min: 0,max: 0,label: 0,color: color[0]});
        }
        options.visualMap.pieces = pieces;
        /*options.visualMap.max = max;
        options.visualMap.min = min;*/
        return options;
      },
      /*获取DMA信息*/
      async getInf() {
        let wc,lf,data = [];
        let time = new Date(new Date().getTime() - 24 * 3600 * 1000);
        let yy = time.getFullYear();
        let mm = time.getMonth() + 1;
        mm = mm < 10 ? '0' + mm : mm;
        let dd = time.getDate();
        dd = dd < 10 ? '0' + dd : dd;
        let inf = await this.$api.buildingInf.findALL();
        if(typeof inf == 'object' && inf.length > 0) {
          inf = inf.filter(item => item.remark == '1');
          inf.forEach(item => {
            this.$api.buildingData.findLeakageIndex({buildingid: item.id,time: yy + '-' + mm + '-' + dd}).then(res => {
              let a = res.data;
              if(a) {
                data.push({
                  id: item.id,
                  name: item.name,
                  address: item.address,
                  value: a.leakageIndex,
                  total: a.total,
                  addTotal: a.addTotal,
                  addRangeTotal: parseFloat(a.addRangeTotal),
                  addMin: a.addMin,
                  addRangeMin: parseFloat(a.addRangeMin),
                  leakageIndex: a.leakageIndex,
                })
              }else {
                data.push({
                  id: item.id,
                  name: item.name,
                  address: item.address,
                  value: 0,
                  total: 0,
                  addTotal: 0,
                  addRangeTotal: 0,
                  addMin: 0,
                  addRangeMin: 0,
                  leakageIndex: 0,
                })
              }
              if(data.length == inf.length) {
                /*this.legend = res.data;
                wc = data.filter(item => item.address == '武汉工程大学武昌校区');
                lf = data.filter(item => item.address == '武汉工程大学流芳校区');
                this.dt1 = wc;
                this.dt2 = lf;
                this.init1();
                this.init2();*/
                this.$api.navigation.findAllStandard().then(res => {
                  this.legend = res.data;
                  wc = data.filter(item => item.address == '武汉工程大学武昌校区');
                  lf = data.filter(item => item.address == '武汉工程大学流芳校区');
                  this.dt1 = wc;
                  this.dt2 = lf;
                  this.init1();
                  this.init2();
                })
              }
            })
          })
        }
      },
      /*切换跳转路径*/
      changeUrl() {
        switch(this.radioUrl) {
          case '1' : this.url = 'BuildingWaterUseOverview';
            break;
          case '2' : this.url = 'BuildingWaterSupervision';
            break;
          case '3' : this.url = 'BuildingMinimumFlowMonitoring';
            break;
        }
      },
      /*切换指标*/
      change(params) {
        switch (params) {
          case '10': this.changeByName('total');
            break;
          case '20': this.changeByName('addTotal');
            break;
          case '30': this.changeByName('addRangeTotal');
            break;
          case '50': this.changeByName('addMin');
            break;
          case '60': this.changeByName('addRangeMin');
            break;
          case '70': this.changeByName('leakageIndex');
            break;
        }
        this.init1();
        this.init2();
      },
      /*根据字段名切换value的值*/
      changeByName(name) {
        this.dt1.forEach(item => {
          item.value = item[name];
        })
        this.dt2.forEach(item => {
          item.value = item[name];
        })
      },
      /*根据字段名取出最大值和最小值*/
      getMaxAndMin(arr,name) {
        arr.sort(this.compare(name));
        return {max: arr[0][name],min: arr[arr.length-1][name]};
      },
      /*指标参数赋值给dt对应的DMA value*/
      /*对象数组排序*/
      compare(name) {
        return function(a,b) {
          var value1 = a[name];
          var value2 = b[name];
          return value1 - value2;
        }
      },
      /*initBg1() {
        let options = map.getBgOptions();
        echarts.registerMap('bg',wuChangBg);
        var myChart = echarts.init(this.$refs.bgmap);
        myChart.setOption(options,true);
      },
      initBg2() {
        let options = map.getBgOptions1();
        echarts.registerMap('bg',liuFangBg)
        var myChart = echarts.init(this.$refs.bgmapL);
        myChart.setOption(options,true);
      },*/
      init1(){
        let options = map.getMapOptions(this.dt1);
        /*this.options1.visualMap.max = params.max;
        this.options1.visualMap.min = params.min;*/
        options = this.getLegendData(options);
        echarts.registerMap('wc',wuChang);
        var myChart = echarts.init(this.$refs.map);
        myChart.setOption(options,true);
        myChart.on('click',(params)=>{
          this.$router.push({
            name:this.url,
            params:{
              name:params.data.name,
              id : params.data.id
            }
          })
        })
      },
      init2() {
        let options = map.getMapOptions1(this.dt2);
        options = this.getLegendData(options);
        echarts.registerMap('lf',liuFang);
        var myChart = echarts.init(this.$refs.mapL);
        myChart.setOption(options,true);
        myChart.on('click',(params)=>{
          this.$router.push({
            name:this.url,
            params:{
              name:params.data.name,
              id : params.data.id
            }
          })
        })
      }
    }
  }
</script>

